import './App.css';

function App() {
  let nome = "Genilson";
  let sobrenome = "Monteiro";
  const classe = "hello-class";
  function nomeCompleto(props){
    return props.nome + " " + props.sobrenome;
  }
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello, {nomeCompleto({nome: "Genilson", sobrenome: "Monteiro"})}</h1>


      </header>
    </div>
  );
}

export default App;
